import React, { Component } from 'react';
import {FirebaseDatabaseMutation}
                         from "@react-firebase/database";
import './set-sensetive.css';

export default class SetSensetive extends Component {

  state = {
    person: null,
    setSensetive : 1,
    setFront : 1
  };

  setSens = (event)=>{
    let evValue=parseInt(event.target.value, 10);
    console.log("event"+evValue);
    this.setState({setSensetive:evValue});
  }

  setFrontF=(event)=>{
    console.log(typeof(parseInt(event.target.value,10)));
    console.log(parseInt(event.target.value,10));
    if(isNaN(parseInt(event.target.value,10))||
                parseInt(event.target.value,10)>1000){
        alert("Namber must be integer and less 1000")
    } else   { 
      this.setState({setFront: parseInt(event.target.value,10)});
      console.log(this.state.setFront);
      console.log(parseInt(event.target.value,10));
    }
 }

  render() {
    const path = this.props.path;
    return (
      <div>

          <FirebaseDatabaseMutation type="set" path={path}>
             {({ runMutation }) => {
                return (
                  <div>
                  <input type = "number" size="4" className="butnSens" onChange ={this.setSens} value={this.state.setSensetive}/><br/>
                  <input type = "number" size="4" className="butnSens" onChange ={this.setFrontF} value={this.state.setFront}/><br/>

                  <button
                      data-testid="test-push"
                      onClick={async () => {
                        const { key } = await runMutation({ PARAM: this.state.setSensetive , Front: this.state.setFront});
                        this.setState({ pushedKey: key });
                        console.log("key"+key);
                      }}
                    > {this.props.btnText}
                    </button><br/>


                  </div>
                );
              }}
          </FirebaseDatabaseMutation>
      </div>
    )
  }
}
